            "1" : {
                "OBJECT-TYPE": "idOper",
                "SYNTAX": "INTEGER",
                "MAX-ACCESS": "not-accessible",
                "STATUS" : "current",
                "DESCRIPTION": "Inteiro identificador do pedido efectuado"
                },
            "2" : {
                "OBJECT-TYPE": "typeOper",
                "SYNTAX": "INTEGER",
                "MAX-ACCESS": "not-accessible",
                "STATUS" : "current",
                "DESCRIPTION": "Inteiro que significa que get caso seja 0, getnext se for 1, getbulk se for 2, set se for 3"
                },
            "3" : {
                "OBJECT-TYPE": "idSource",
                "SYNTAX": "OCTET STRING",
                "MAX-ACCESS": "not-accessible",
                "STATUS" : "current",
                "DESCRIPTION": "String que representa o identificador do agente que efectuou o pedido"
                },
            "4": {
                "OBJECT-TYPE": "idDestination",
                "SYNTAX": "OCTET STRING",
                "MAX-ACCESS": "not-accessible",
                "STATUS" : "current",
