                },
            "7" : {
                "OBJECT-TYPE": "typeArg",
                "SYNTAX": "INTEGER",
                "MAX-ACCESS": "not-accessible",
                "STATUS" : "current",
                "DESCRIPTION": "Inteiro que representa o tipo de dados recebidos como resposta ao pedido"
                },
            "8" : {
                "OBJECT-TYPE": "sizeArg",
                "SYNTAX": "INTEGER",
                "MAX-ACCESS": "not-accessible",
